pragma solidity ^0.4.0;

contract sell{

    //struct barang yang dijual
    struct goods{
        address owner;
        string code;
        uint prize;
        bool sold;
    }
    uint id=1;

    goods[] public seller;

    function selling(string code, uint prize) public{
        seller[id].owner = msg.sender;
        seller[id].code = code;
        seller[id].prize = prize;
        seller[id].sold = false;

        id++;
    }

    function getcode(uint idGoods) view public returns(string){
        require(msg.sender == seller[idGoods].owner);

        return seller[idGoods].code;
    }
}
